import React from 'react'


const Products = () => {

    const products = ["Learning React", "Pro React", "Begining React"]

    const productList = products.map((product) => {
        <li key={product.toString()}>{product}</li>
    })
    return (
        <div>
            <h2>Products</h2>
        </div>
    );
}

export default Products;
